  KEY `ComplianceCode` (`ComplianceCode`),
  KEY `DigestExtractCode` (`DigestExtractCode`),
  KEY `LabSampleID` (`LabSampleID`),
  KEY `PrepCode` (`PrepCode`),
  KEY `QACode` (`QACode`),
  KEY `ResQualCode` (`ResQualCode`),
  KEY `SampleID` (`SampleID`),
  KEY `Index_qaflag` (`QAFlag`),
  CONSTRAINT `FK_LabResultComplianceCode` FOREIGN KEY (`ComplianceCode`) REFERENCES `compliancelevellookup` (`ComplianceCode`),
  CONSTRAINT `FK_LabResultConstituentRowID` FOREIGN KEY (`ConstituentRowID`) REFERENCES `constituentlookup` (`ConstituentRowID`) ON UPDATE CASCADE,
